function onLoad()
    function createcards(name, fimg, bimg)
        local obj =
            spawnObjectData(
            {
                data = {
                    Name = "CardCustom",
                    Transform = {
                        posX = 0,
                        posY = 0,
                        posZ = 0,
                        rotX = 0,
                        rotY = 0,
                        rotZ = 0,
                        scaleX = 1,
                        scaleY = 1,
                        scaleZ = 1
                    }
                },
                callback_function = function(spawned_object)
                    log(spawned_object.getBounds())
                end
            }
        )

        obj.setPositionSmooth({-5, 10, 0})
        param = {
            type = 4,
            face = fimg,
            back = bimg
        }
        obj.setCustomObject(param)

        obj.setName(name)
        obj.setDescription(math.random())
    end

    for index,object in ipairs(data) do

        createcards(object[1],object[2],object[2] )
            

    end


end